(function() {
    'use strict';

    const url = window.location.href;
    if (url.startsWith("https://m.freebuf.com")) {
        const new_url = url.replace(/^.{0,21}/, "https://www.freebuf.com")
        window.location.replace(new_url)
    } else {
        console.error("Wrong pattern?")
    }
})();